  public getContinents() {
    this.importContinents();
    for (const country of this.countries) {
      let obj = this.backendCountries.find(obj => obj.alpha2Code == country.alpha2Code);
      if(obj !== undefined){
        if(obj.continentId){
            let continentIndex = this.getContinentIndex(obj.continentId); 
            if (continentIndex != -1) {
              country.id = obj.id;
              country.allowedJoin = obj.allowedJoin;
              country.allowedBuy = obj.allowedBuy;
              country.allowedView = obj.allowedView;
              country.isActive = obj.isActive;
              //this.continents[continentIndex].path.push(country.path);
              this.continents[continentIndex].countries.push(country);
            }
        }
      }
      else{
        if (country.alpha2Code == "CG"){
          let continentIndex = this.getContinentIndex(1);
          country.allowedJoin = false;
          country.allowedBuy = false;
          country.allowedView = false;
          country.isActive = false;
          this.continents[continentIndex].countries.push(country);
        }
      }
      
      
    }
    return this.continents;
  }

  public getCountriesByContinentId(id: number){
    //filter also by some criteria
    return this.backendCountries.filter(obj => obj.continentId == id);
  }

  getContinentIndex(id: Number) {
    return this.continents.findIndex((e) => {
      return e.id == id
    })
  }
  
  
